var Hapi = require('hapi');

var server = Hapi.createServer('localhost', process.argv[2] || 8000, {
  cors: true
});

var breaks = [{
  id: 1,
  name: 'Carcavelos',
  type: 'Beach Break',
  direction: 'Left and Right',
  favorite: false,
  mswid: 912,
  image: 'data:image/jpeg;base64,'
}, {
  id: 2,
  name: 'Guincho',
  type: 'Beach Break',
  direction: 'Left and Right',
  favorite: true,
  mswid: 199,
  image: 'data:image/jpeg;base64,'
}, {
  id: 3,
  name: 'Caparica',
  type: 'Beach Break',
  direction: 'Left and Right',
  favorite: false,
  mswid: 874,
  image: 'data:image/jpeg;base64,'
}, {
  id: 4,
  name: 'Praia Grande',
  type: 'Beach Break',
  direction: 'Left and Right',
  favorite: true,
  mswid: 1257,
  image: 'data:image/jpeg;base64,'
}];

server.route({
  method: 'GET',
  path: '/breaks',
  handler: function(request, reply) {
    return reply(breaks);
  }
});

server.route({
  method: 'GET',
  path: '/breaks/{id}',
  handler: function(request, reply) {
    if (request.params.id) {
      if (request.params.id > 0 && request.params.id <= breaks.length) {
        return reply(breaks[request.params.id - 1]);
      } else {
        return reply('Break not found.')
          .code(404);
      }
    }
  }
});

server.start();